package com.quizmakers.core.data.quizzes.remote

import android.graphics.Bitmap
import android.graphics.BitmapFactory
import android.net.Uri
import android.util.Base64
import okio.ByteString.Companion.decodeBase64


data class Question(
    val question: String,
    val options: List<String>,
    val correctAnswer: String,
    val imageBase64: String? = ""
    //"https://fajnepodroze.pl/wp-content/uploads/2020/03/Krajobraz.jpg"
) {
    val imageBitmap = imageBase64?.decodeImage()

    // TODO Takie parsery powinny by robione w warstwie przezentacji w data trzeba zmieni to pniej .
    private fun String.decodeImage(): Bitmap {
        val byteArray = Base64.decode(this, Base64.DEFAULT)
        return BitmapFactory.decodeByteArray(byteArray, 0, byteArray.size)
    }
}

data class QuestionAnswered(
    val quizId: String,
    val optionId: String
)

data class QuizRequestApi(
    val ownerId: Int,
    val title: String,
    val metaTitle: String,
    val summary: String,
    val description: String,
    val type: Int,
    val categoryId: Int,
    val score: Int,
    val publicAvailable: Boolean
)

data class QuestionsRequestApi(
    val questions: List<String>,
    val image: List<String?>,
    val answers: List<List<String>>,
    val correctAnswers: List<Int>,
)

data class CategoryApi(
    val categoryId: Int,
    val category: String,
    val thumbnail: String
)